import React from "react";
import styled from "styled-components";
import img from "../canes.png";

const HeaderImg = styled.div.attrs({
  className: "",
})``;

const HeaderDiv1 = styled.div.attrs({
  className: "py-20",
})``;

const HeaderDiv2 = styled.div.attrs({
  className: "",
});

export default function Header() {
  return (
    <HeaderDiv1>
      <HeaderImg>
        <img src={img} alt="Header" />
      </HeaderImg>
    </HeaderDiv1>
  );
}
